import React, { useState } from "react";
import CalendarPopup from "../Calendar/CalendarPopup"; // Ï∫òÎ¶∞Îçî ÌåùÏóÖ import ÌïÑÏöî

const PasswordPopup = ({ onClose }) => {
    const [input, setInput] = useState(""); // ÎπÑÎ∞ÄÎ≤àÌò∏ ÏûÖÎ†•Í∞í ÏÉÅÌÉú
    const [step, setStep] = useState("password"); // Îã®Í≥Ñ ÏÉÅÌÉú: "password" -> "calendar"

    // ÌÇ§Ìå®Îìú ÌÅ¥Î¶≠ Ïãú Ïà´Ïûê Ï∂îÍ∞Ä
    const handleKeyClick = (num) => {
        setInput((prev) => prev + num);
    };

    // ÎπÑÎ∞ÄÎ≤àÌò∏ ÏûÖÎ†• Î≥ÄÍ≤Ω Ìï∏Îì§Îü¨ (input ÌïÑÎìúÏö©)
    const handleChange = (e) => {
        setInput(e.target.value);
    };

    // Î∞±Ïä§ÌéòÏù¥Ïä§ Í∏∞Îä•
    const handleBackspace = () => {
        setInput((prev) => prev.slice(0, -1));
    };

    // ÏûÖÎ†• Ï¥àÍ∏∞Ìôî
    const handleReset = () => {
        setInput("");
    };

    // ÎπÑÎ∞ÄÎ≤àÌò∏ ÌôïÏù∏ ÌõÑ Ï∫òÎ¶∞ÎçîÎ°ú Ïù¥Îèô
    const handleSubmit = () => {
        if (input === "01234") { // ÏòàÏ†ú ÎπÑÎ∞ÄÎ≤àÌò∏
            setStep("calendar");
        } else {
            alert("ÎπÑÎ∞ÄÎ≤àÌò∏Í∞Ä ÌãÄÎ†∏ÏäµÎãàÎã§!");
            setInput("");
        }
    };

    // üîπ ÌéòÏù¥ÏßÄ Ïù¥ÎèôÏùÑ ÏúÑÌïú Ìï®Ïàò (ÌïÑÏöî Ïãú ÏÇ¨Ïö©)
    const handleNavigate = () => {
        console.log("Navigating..."); // Ïã§Ï†ú ÎÑ§ÎπÑÍ≤åÏù¥ÏÖò Î°úÏßÅ Ï∂îÍ∞Ä Í∞ÄÎä•
    };

    return (
        <div className="popup-overlay">
            <div className="popup-content">
                {step === "password" && (
                    <>
                        <h2>ÎπÑÎ∞ÄÎ≤àÌò∏ ÏûÖÎ†•</h2>
                        <p>ÏûÖÏû•ÌïòÎ†§Î©¥ ÎπÑÎ∞ÄÎ≤àÌò∏Î•º ÏûÖÎ†•ÌïòÏÑ∏Ïöî.</p>

                        {/* ÎπÑÎ∞ÄÎ≤àÌò∏ ÏûÖÎ†•Ï∞Ω */}
                        <input 
                            type="password" 
                            value={input} 
                            onChange={handleChange} 
                            placeholder="ÎπÑÎ∞ÄÎ≤àÌò∏ ÏûÖÎ†•" 
                        />

                        {/* ÌÇ§Ìå®Îìú UI */}
                        <div className="keyboard-container">
                            <div className="display">
                                {input.split("").map((char, index) => (
                                    <div key={index} className="black-key">
                                        {char}
                                    </div>
                                ))}
                            </div>

                            {/* Ïà´Ïûê ÌÇ§Ìå®Îìú */}
                            <div className="key" onClick={() => handleKeyClick("1")}>1</div>
                            <div className="key" onClick={() => handleKeyClick("2")}>2</div>
                            <div className="key" onClick={() => handleKeyClick("3")}>3</div>
                            <div className="action-key" onClick={handleReset}>‚Üª</div>

                            <div className="key" onClick={() => handleKeyClick("4")}>4</div>
                            <div className="key" onClick={() => handleKeyClick("5")}>5</div>
                            <div className="key" onClick={() => handleKeyClick("6")}>6</div>
                            <div className="action-key" onClick={handleBackspace}>‚å´</div>

                            <div className="key" onClick={() => handleKeyClick("7")}>7</div>
                            <div className="key" onClick={() => handleKeyClick("8")}>8</div>
                            <div className="key" onClick={() => handleKeyClick("9")}>9</div>
                            <div></div>

                            <div></div>
                            <div className="key" onClick={() => handleKeyClick("0")}>0</div>
                            <div></div>
                            <div></div>
                        </div>

                        {/* ÌôïÏù∏ Î≤ÑÌäº */}
                        <button className="submit-btn" onClick={handleSubmit}>
                            ÌôïÏù∏
                        </button>

                        {/* üîπ ÌéòÏù¥ÏßÄ Ïù¥Îèô Î≤ÑÌäº Ï∂îÍ∞Ä (handleNavigate ÏÇ¨Ïö© ÏòàÏãú) */}
                        <button className="navigate-btn" onClick={handleNavigate}>
                            Ïù¥ÎèôÌïòÍ∏∞
                        </button>
                    </>
                )}

                {/* ‚úÖ ÎπÑÎ∞ÄÎ≤àÌò∏ ÏÑ±Í≥µ Ïãú Ï∫òÎ¶∞Îçî ÌôîÎ©¥ Î†åÎçîÎßÅ */}
                {step === "calendar" && <CalendarPopup onClose={onClose} />}
            </div>
        </div>
    );
};

export default PasswordPopup;
